// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.6.12;

import {ChangeContract} from "../moc-governance/Governance/ChangeContract.sol";
import {IRegistry} from "../IRegistry.sol";
import {RegistryConstants} from "../RegistryConstants.sol";

/**
  @title MocFlowRegistryClearChange
  @notice This contract is a ChangeContract intended to initialize clear all the MOC Flow registry values
 */
contract MocFlowRegistryClearChange is ChangeContract, RegistryConstants {
    IRegistry public registry;

    /**
      @notice Constructor
    */
    constructor(IRegistry _registry) public {
        registry = _registry;
    }

    /**
      @notice Execute the changes.
      @dev Should be called by the governor, but this contract does not check that explicitly because it is
      not its responsability in the current architecture
     */
    function execute() external override {
        require(address(registry) != address(0), "Use once");
        registry.clearAddressArray(MOC_FLOW_BUFFERS);
        registry.clearAddressArray(MOC_FLOW_DRIPPERS);
        registry.clearAddressArray(MOC_FLOW_COINERS);
        registry.clearAddressArray(MOC_FLOW_REVERSE_AUCTIONS);
        // usable just once!!!
        registry = IRegistry(0);
    }
}

